import React from "react";
import "./Projects.css";

const Projects = () => {
    return (
        <div>
            <h1>Title and Team Members and explanation of your role(s) on the project</h1>
            <h1>Executive Summary Statement</h1>
            <h1>Problem</h1>
            <h1>Methods</h1>
            <h1>Evidence (Quotes)</h1>
            <h1>Insights</h1>
            <h1>Implications/Solution</h1>
        </div>
    );
  };

  export default Projects;
